  false,\n\t\"url\": null,\n\t\"notes\": \"The 2015 cartographic boundary KMLs are
  simplified representations of selected geographic areas from the U.S. Census Bureau's
  Mastern                                 Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). These boundary
  files aren                                 specifically designed for small-scale
  thematic mapping. When possible, generalization is performed with the intent to
  maintain then                                 hierarchical relationships among geographies
  and to maintain the alignment of geographies within a file set for a given year.n
  \                                Geographic areas may not align with the same areas
  from another year. Some geographies are available as nation-based files while othersn
  \                                are available only as state-based files.nn                                 The
  cartographic boundary files include both incorporated places (legal entities) and
  census designated places or CDPs (statisticaln                                 entities).
  \ An incorporated place is established to provide governmental functions for a concentration
  of people as opposed to a minorn                                 civil division
  (MCD), which generally is created to provide services or administer an area without
  regard, necessarily, to population.n                                 Places always
  nest within a state, but may extend across county and county subdivision boundaries.
  \ An incorporated place usually is an                                 city, town,
  village, or borough, but can have other legal descriptions.  CDPs are delineated
  for the decennial census as then                                 statistical counterparts
  of incorporated places.  CDPs are delineated to provide data for settled concentrations
  of population that aren                                 identifiable by name, but
  are not legally incorporated under the laws of the state in which they are located.
  \ The boundaries for CDPsn                                 often are defined in
  partnership with state, local, and/or tribal officials and usually coincide with
  visible features or the boundaryn                                 of an adjacent
  incorporated place or another legal entity.  CDP boundaries often change from one
  decennial census to the next withn                                 changes in the
  settlement pattern and development; a CDP with the same name as in an earlier census
  does not necessarily have the samen                                 boundary.  The
  only population/housing size requirement for CDPs is that they must contain some
  housing and population.n            \",\n\t\"license_title\": null,\n\t\"extras\":
